Use Portal_Data
Go

Alter Proc Test.pTestNB
(
	@SAPAccountNumbers varchar(8000)
)

As
Begin
	--Select Replace(Replace(Rtrim(LTrim(Value)), Char(13), ''), Char(10), '')  SAPAccountNumber
	--From dbo.Split(@SAPAccountNumbers, ',');

	With Output1 
	As 
	(
		select A.SAPAccountNumber, right(caseMDM.SAPMaterialNumber,8) SAPMaterialID, caseMDM.ean11, count(caseMDM.ean11) over(partition by A.SAPAccountNumber, caseMDM.ean11) matcnt, DNA.AccountID, M.MaterialName, A.AccountName, LastInvoiceDate
		from ADW.ADW.FACTDNA DNA                                                  
		join ADW.ADW.DimMDMProduct SellMDM with (nolock) on DNA.MDMID = SellMDM.MDMID                            
		join ADW.ADW.DimMDMProduct CaseMDM with (nolock) on SellMDM.EAN11 = CaseMDM.EAN11                                                                          
		join ADW.ADW.DimMaterial M with (nolock) on caseMDM.SAPMaterialNumber = M.SAPMaterialNumber                                                                         
		join ADW.ADW.FactRMMaterialAccount RMMA with (nolock) on M.materialid = RMMA.materialid and DNA.AccountID = RMMA.AccountID                                                                              
		join ADW.ADW.DimAccount A with (nolock) on DNA.accountid = A.accountid                                                                               
		join 
		(
			Select Replace(Replace(Rtrim(LTrim(Value)), Char(13), ''), Char(10), '')  SAPAccountNumber
			From dbo.Split(@SAPAccountNumbers, ',')
		) PL on A.SAPAccountNumber = PL.SAPAccountNumber
		and DNA.ispog=1 and DNA.isvoid=1
		and caseMDM.BaseUnitID = 'CS'
	)

	select O1.SAPAccountNumber, O1.SAPMaterialID, 1 default_orderqty
	from Output1 O1
	left join DNA.Snoozing SNOOZE  with (nolock) ON O1.SAPAccountNumber = SNOOZE.SAPAccountNumber AND O1.SAPMaterialID = SNOOZE.SAPMaterialID
	where O1.matcnt=1
	and ((SNOOZE.SnoozeDate is Null) or (SNOOZE.SnoozeDate < getDate()))
	Union
	select O2.SAPAccountNumber, O2.SAPMaterialID, 1 default_orderqty
	  from
	(
		select O1.SAPAccountNumber, O1.SAPMaterialID, O1.ean11, lo.LastOrderedDate, max(LO.LastOrderedDate) over(partition by O1.sapaccountnumber, O1.ean11) lodate
		  from output1 O1
		  left join DNA.RMDSDLastOrder LO with (nolock) on O1.SAPMaterialID = LO.SAPMaterialID AND O1.SAPMaterialID = LO.SAPMaterialID
		 where O1.matcnt != 1
		   and O1.LastInvoiceDate = LO.LastOrderedDate or O1.LastInvoiceDate is null
	) O2
	  left join PORTAL_DATA.DNA.Snoozing SNOOZE  with (nolock) on O2.SAPAccountNumber = SNOOZE.SAPAccountNumber AND O2.SAPMaterialID = SNOOZE.SAPMaterialID
	where ((SNOOZE.SnoozeDate is Null) Or (SNOOZE.SnoozeDate < getDate()))

End

Go

